INSERT INTO `flashcard_content` VALUES (1,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','관계형 데이터베이스에서 조(레코드)의 식별자로 이용하기에 가장 적합한 것을 관계 (테이블)마다 단 한 설계자에 의해 선택, 정의된 후보 키',1),(2,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','행과 열의 형식으로 보관된 관련 데이터의 모음',2),(3,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','지정된 수의 열이 있지만 행 수에는 제한이 없음',2),(4,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','한 테이블의 필드(attribute) 중 다른 테이블의 행(row)을 식별할 수 있는 키',3),(5,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','다른 테이블의 기본 키를 참조하여 두 테이블을 연결하는 테이블의 속성 집합',3),(6,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','테이블에 대한 동작의 속도를 높여주는 자료 구조',4),(7,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','테이블의 모든 행을 검색할 필요 없이 데이터를 빠르게 찾는 데 사용',4),(8,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','데이터베이스 내에서 수행되는 작업 단위',5),(9,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','각각의 트랜잭션에 대해 원자성(Atomicity), 일관성(Consistency), 독립성(Isolation), 영구성(Durability)을 보장',5),(10,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','데이터베이스에서 자료의 구조, 자료의 표현 방법, 자료 간의 관계를 형식 언어로 정의한 구조',6),(11,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','데이터베이스의 데이터 구성을 나타냄',6),(12,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','관계형 데이터베이스의 설계에서 중복을 최소화하게 데이터를 구조화하는 프로세스',7),(13,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','정규화란 크고, 제대로 조직되지 않은 테이블들과 관계들을 작고 잘 조직된 테이블과 관계들로 나누는 것',7),(14,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','기본 테이블로부터 파생하여 만든 가상의 테이블',8),(15,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','실제 테이블과 달리 데이터 자체를 포함하고 있는 것은 아님',8),(16,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','관계형 데이터베이스 관리 시스템(RDBMS)의 데이터를 관리하기 위해 설계한 특수 목적의 프로그래밍 언어',9),(17,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','데이터 쿼리, 데이터 조작(insert, update, and delete), 데이터 정의(스키마 생성 및 수정), 데이터 액세스 제어가 포함',9),(18,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','테이블에 대한 이벤트에 반응해 자동으로 실행되는 작업',10),(19,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','데이터 작업 제한, 작업 기록, 변경 작업 감사 등을 할 수 있음',10),(20,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','컴퓨터의 뇌로서, 프로그램에서 명령어를 해석하고 실행하는 핵심 부품',11),(21,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','제어 유닛은 명령어를 해독하고 실행하는 역할을 하며, 산술 논리 연산 장치(ALU)는 산술 연산과 논리 연산을 수행',11),(22,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','레지스터는 매우 빠른 속도로 데이터를 저장하고 처리하는데 사용',11),(23,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','데이터와 명령을 저장하는 공간',12),(24,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','주 기억장치(RAM)는 현재 실행 중인 프로그램과 데이터를 저장하며, 보조 기억장치(하드 디스크, SSD)는 영구적인 데이터 저장을 담당',12),(25,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','캐시도 메모리의 일종으로, 빠른 데이터 접근을 위해 사용',12),(26,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','CPU, 메모리, 그리고 입출력 장치 등 각 구성 요소 간에 데이터, 주소, 제어 신호를 전송하는 통로',13),(27,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','주소 버스는 메모리 위치를 지정하고, 데이터 버스는 실제 데이터를 전송하며, 제어 버스는 명령과 상태 정보를 전송',13),(28,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','CPU 내부에 위치한 소량의 고속 기억장치',14),(29,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','현재 수행 중인 명령어나 연산에 필요한 데이터를 일시적으로 저장',14),(30,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','레지스터는 ALU에서의 계산에 필수적이며, 레지스터의 크기와 수는 CPU의 성능에 영향을 미침',14),(31,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','CPU가 이해하고 실행하는 명령어의 집합',15),(32,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','각 명령어는 특정한 동작을 수행하며, 이러한 명령어들을 조합하여 프로그램이 동작',15),(33,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','명령어 처리를 여러 단계로 분할하여 병렬적으로 실행하는 구조',16),(34,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','이를 통해 여러 명령어가 동시에 처리되어 CPU의 성능이 향상',16),(35,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','빠른 속도로 접근 가능한 작은 용량의 메모리',17),(36,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','CPU가 자주 사용하는 데이터를 일시적으로 저장하여 메인 메모리에 접근하는 속도를 향상',17),(37,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','주로 L1, L2, L3 캐시로 구성',17),(38,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','전체 시스템의 동기화를 담당하는 신호',18),(39,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','CPU와 다른 시스템 구성 요소의 동작 주기를 조절',18),(40,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','클럭 주파수가 높을수록 더 빠른 연산이 가능',18),(41,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','CPU가 현재 수행 중인 작업을 중단하고 외부 이벤트에 대응하는 메커니즘',19),(42,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','하드웨어나 소프트웨어에서 발생할 수 있으며, 시스템의 효율적인 동작과 응답성을 보장',19),(43,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','내장된 소프트웨어로, 하드웨어 초기화, 부팅, 기본 시스템 설정 및 제어를 담당',20),(44,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','주로 ROM 또는 플래시 메모리에 저장되며, 시스템의 안정성과 동작을 지원',20),(45,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','펌웨어는 업데이트 가능하며, 제조사가 제공하는 업데이트로 기능 확장 가능',20),(46,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','인접한 두 원소를 비교하면서 필요에 따라 서로 위치를 교환하는 방식',21),(47,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','가장 큰(또는 작은) 원소가 맨 끝으로 이동할 때까지 이 비교와 교환 과정을 반복',21),(48,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','단순하고 이해하기 쉽지만, 정렬해야 하는 원소의 수가 많아질수록 비효율적이며 다른 정렬 알고리즘들보다 느린 성능',21),(49,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','작은 부분 문제들을 풀고, 그 결과를 저장하여 중복 계산을 피하며 최적화하는 알고리즘 기법',22),(50,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','중복된 계산을 피하기 위해 메모이제이션(Memoization) 또는 테이블을 사용하는 방법으로 구현',22),(51,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','그래프의 모든 노드를 최소 비용으로 연결하는 최소 비용 신장 트리(Minimum Spanning Tree)를 찾기 위한 알고리즘 중 하나',23),(52,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','가중치가 가장 작은 간선부터 선택하여 사이클을 피해가며 최소 비용 신장 트리를 구성',23),(53,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','컴퓨터에서 이진수로 표현된 데이터의 각 비트에 대한 연산을 수행하는 데 사용되는 연산자',24),(54,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','주요 비트 연산자로는 AND(&), OR(|), XOR(^), NOT(~) 등이 있다.',24),(55,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','비트 연산은 주로 플래그 조작, 데이터 압축, 네트워크 프로토콜에서의 특정 비트 필드 조작 등 활용',24),(56,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','a << n : a x 2ⁿ',24),(57,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','a >> n : a / 2ⁿ',24),(58,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','예시 : (16 << 1) == 32',24),(59,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','이진 탐색 트리 : 각 노드가 최대 두 개의 자식을 가지며, 왼쪽 자식은 현재 노드보다 작은 값을, 오른쪽 자식은 현재 노드보다 큰 값을 가지는 이진 트리의 특별한 형태',25),(60,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','단말 노드 삭제 : 해당 노드를 삭제',25),(61,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','자식이 하나인 노드 삭제 : 해당 노드 삭제 후 자식 노드로 대체',25),(62,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','자식이 둘인 노드 삭제 : 해당 노드 삭제 후 오른쪽 서브트리에서 가장 작은 노드 또는 왼쪽 서브트리에서 가장 큰 노드로 대체',25),(63,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','그래프 이론에서 사용되는 표현 방법 중 하나로, 노드들 간의 연결 관계를 행렬로 나타내는 방식',26),(64,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','간단하게 구현할 수 있고, 노드 간의 연결 여부를 상수 시간 내에 확인할 수 있지만, 그래프의 크기가 크면 메모리 사용량이 증가',26),(65,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','그래프에서 하나의 출발 노드로부터 모든 다른 노드까지의 최단 경로를 찾기 위한 알고리즘',27),(66,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','음의 가중치를 가지지 않는 그래프에서 사용',27),(67,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','주로 우선순위 큐(Priority Queue)를 사용',27),(68,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','임의의 크기의 데이터를 고정된 크기의 값으로 매핑하는 함수',28),(69,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','해시 테이블, 해시 맵 등에서 사용되며, 데이터의 검색, 저장, 식별을 빠르게 하기 위해 활용',28),(70,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','정렬된 배열이나 리스트에서 주어진 데이터와 찾고자 하는 값을 비교하면서 탐색 범위를 반으로 줄여가며 효율적으로 원소를 찾아내는 방법',29),(71,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','각 단계에서 탐색 범위가 절반으로 줄어들기 때문에 시간 복잡도가 O(log n)',29),(72,'2024-02-15 13:25:08.000000','2024-02-15 13:25:08.000000','그래