INSERT INTO `quiz` VALUES (1,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','중복 없이 각 행을 식별하는 데 사용.','테이블에서 각 행을 고유하게 식별하는 열 또는 열의 조합은?',1),(2,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','열은 데이터의 속성, 행은 각각의 레코드를 나타냄.','데이터를 행과 열의 형태로 구조화한 데이터베이스의 기본 구성 요소는?',1),(3,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','다른 테이블과의 관계를 구축하는 데 사용되는 열.','다른 테이블의 기본 키를 참조하는 열로, 테이블 간의 관계를 정의하는 것은?',1),(4,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','특정 열에 대한 검색 속도를 향상시키는 데 활용.','데이터베이스에서 검색 성능을 향상시키기 위해 사용되는 데이터 구조는?',1),(5,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','모든 조작이 성공하거나 실패할 때만 완료되는 작업 묶음.','하나 이상의 데이터베이스 조작(쿼리)을 묶어서 원자적으로 처리하는 논리적 작업 단위는?',1),(6,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','테이블, 인덱스, 뷰 등의 객체와 관계를 설명하는 구조.','데이터베이스의 구조와 제약 조건을 정의하는 개념은?',1),(7,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','테이블을 나누어 중복을 줄이는 작업.','데이터의 중복을 최소화하고 데이터의 일관성을 유지하기 위해 테이블을 설계하는 프로세스는?',1),(8,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','특정 사용자나 응용프로그램에게 필요한 데이터만 보여주기 위한 가상의 테이블.','하나 이상의 테이블에서 유도된 테이블로, 저장되지 않지만 쿼리에서 사용될 수 있는 가상의 테이블은?',1),(9,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','SELECT, INSERT, UPDATE, DELETE 등이 포함됩니다.','데이터베이스에서 정보를 검색하거나 조작하기 위한 명령문은?',1),(10,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','데이터 변경 시 특정 동작을 수행하는데 사용됨.','특정 이벤트가 발생할 때 자동으로 실행되는 데이터베이스 객체는?',1),(11,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','패킷을 전송하고 받는 경로를 결정하는 역할을 하는 장치입니다.','두 개의 네트워크를 연결하여 통신할 수 있게 해주는 장치는 무엇인가요?',2),(12,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','불법적인 접근으로부터 네트워크를 보호하는 역할을 합니다.','네트워크에서 특정한 서비스에 대한 접근 권한을 부여하거나 거부하는 보안 기술은 무엇인가요?',2),(13,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','클라이언트에게 서비스나 데이터를 제공하는 중심 장치입니다.','네트워크에서 여러 컴퓨터가 동시에 공유할 수 있는 자원이나 정보를 관리하는 시스템은 무엇인가요?',2),(14,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','무선 네트워크에 접속하기 위한 표준 기술입니다.','무선 네트워크에서 사용되는 기술로, 근거리 통신을 위한 무선 통신 규약은 무엇인가요?',2),(15,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','원격으로 다른 컴퓨터에 로그인하고 명령을 실행하는 보안 프로토콜입니다.','네트워크에서 사용자가 다른 컴퓨터에 접속할 때 사용하는 프로토콜은 무엇인가요?',2),(16,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','데이터의 정확성과 순서를 보장하는 연결 지향 프로토콜입니다.','네트워크에서 사용되는 통신 규약으로, 전송 계층에서 데이터의 신뢰성을 보장하는 프로토콜은 무엇인가요?',2),(17,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','데이터의 경로를 결정하고 패킷을 목적지까지 전달하는 역할을 합니다.','인터넷에서 사용되는 통신 규약으로, 전송 계층에서 데이터를 패킷으로 분할하여 전송하는 프로토콜은 무엇인가요?',2),(18,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','서로 다른 네트워크 간의 통신을 중계하고 연결하는 역할을 합니다.','컴퓨터 네트워크에서 서로 다른 네트워크를 연결하여 통신할 수 있게 하는 장치는 무엇인가요?',2),(19,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','네트워크 인터페이스 카드에 할당된 고유한 식별자입니다.','네트워크에서 각 장치의 물리적인 주소를 나타내는 고유한 식별자는 무엇인가요?',2),(20,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','두 개의 네트워크를 연결하여 데이터 전송을 지원하는 장치입니다.','네트워크에서 서로 다른 네트워크 간에 통신을 중계하고 연결하는 역할을 하는 장치는 무엇인가요?',2),(21,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','전송 신뢰성이 낮지만 실시간 통신에 적합한 프로토콜입니다.','네트워크에서 데이터 전송 중 오류를 감지하고, 필요한 경우 재전송을 요청하는 프로토콜은 무엇인가요?',2),(22,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','웹 페이지나 웹 애플리케이션을 호스팅하는 역할을 하는 서버입니다.','컴퓨터 네트워크에서 사용자의 요청을 받아 웹 페이지 등의 정보를 제공하는 서버를 뭐라고 하나요?',2),(23,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','파일 전송과 관련된 네트워크 프로토콜입니다.','네트워크에서 원격으로 다른 시스템에 접속하여 파일을 전송하거나 명령을 실행하는 프로토콜은 무엇인가요?',2),(24,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','주로 휴대폰, 스마트 스피커 등에서 사용되는 기술입니다.','무선 네트워크에서 기기 간의 통신을 가능케 하는 근거리 통신 기술은 무엇인가요?',2),(25,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','IP 주소를 서브넷으로 분리하는 데 사용되는 32비트의 숫자입니다.','IP 주소를 서브넷으로 분리하여 네트워크를 효율적으로 관리하고 라우팅을 지원하는데 사용되는 숫자는? ',2),(26,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','호스트의 도메인 이름을 해당 호스트의 IP 주소로 변환하는 시스템입니다.','호스트의 도메인 이름을 해당 호스트의 IP 주소로 변환하는 시스템은?',2),(27,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','공중 네트워크를 통해 안전하게 데이터를 전송하기 위한 가상의 사설 네트워크를 구축하는 기술입니다. 원격 접속 보안을 제공합니다.','공중 네트워크를 통해 안전하게 데이터를 전송하기 위한 가상의 사설 네트워크는? ',2),(28,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','작은 지리적 범위에서 고속의 데이터 전송과 공유 리소스를 제공하여 조직 내 효율성을 향상시키는 네트워크입니다.','로컬 영역에서 고속의 데이터 전송과 공유 리소스를 제공하여 조직 내 효율성을 향상시키는 네트워크는? ',2),(29,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','여러 지역이나 도시를 연결하여 지리적으로 넓은 범위에 걸쳐 있는 네트워크를 의미합니다.','여러 지역이나 도시를 연결하여 지리적으로 넓은 범위에 걸쳐 있는 네트워크는? ',2),(30,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','명령어 처리를 담당하며, 명령어의 해석과 실행을 수행합니다.','CPU의 핵심 부품 중 하나로, 명령어를 해석하고 실행하는 역할을 하는 것은?',5),(31,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','주로 데이터, 주소, 제어 신호를 전송하는 중요한 통로입니다.','CPU, 메모리, 그리고 다른 하드웨어 간에 데이터 전송을 도와주는 통로는 무엇인가요?',5),(32,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','메인 메모리보다 더 빠른 속도로 접근 가능한 작은 용량의 메모리입니다.','CPU가 자주 사용하는 데이터에 빠르게 접근하기 위해 사용되는 고속 메모리는 무엇인가요?',5),(33,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','CPU가 수행 가능한 기본적인 동작들이 정의된 명령어 집합입니다.','CPU가 이해하고 실행하는 명령어의 집합을 뭐라고 하나요?',5),(34,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','CPU와 다른 하드웨어 구성 요소의 동작을 동기화하는 역할을 합니다.','모든 시스템 구성 요소가 동일한 속도로 동작하도록 하는 중요한 신호는 무엇인가요?',5),(35,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','작업을 여러 단계로 나누어 동시에 처리하는 구조입니다.','CPU의 명령어 처리를 여러 단계로 분할하여 병렬적으로 실행하는 구조를 뭐라고 하나요?',5),(36,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','명령어 실행에 필요한 데이터를 일시적으로 저장하는 역할을 합니다.','CPU 내부에서 데이터를 빠르게 저장하고 처리하는 데 사용되는 소량의 고속 기억장치는 무엇인가요?',5),(37,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','ROM 또는 플래시 메모리에 저장되어 시스템의 초기 동작을 지원합니다.','하드웨어 초기화, 부팅, 기본 시스템 설정을 담당하는 내장 소프트웨어는 무엇인가요?',5),(38,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','CPU가 현재 작업을 중단하고 특정 이벤트에 응답하는 시스템 메커니즘입니다.','시스템에서 발생하는 예외적인 상황이나 외부 이벤트에 대응하기 위한 메커니즘은 무엇인가요?',5),(39,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','현재 실행 중인 프로그램과 데이터를 임시로 저장하는 역할을 합니다.','데이터와 명령을 저장하는 공간으로, RAM과 하드 디스크 등이 속하는 주 기억장치는 무엇인가요?',5),(40,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','가장 큰(또는 작은) 원소가 맨 끝으로 이동할 때까지 이 비교와 교환 과정을 반복합니다','인접한 두 원소를 비교하여 순서를 교환하는 정렬 알고리즘은?',4),(41,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','메모이제이션을 활용합니다.','작은 부분 문제들을 풀고, 그 해답을 저장하여 중복 계산을 피하며 최적화하는 알고리즘 기법은?',4),(42,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','최소 신장 트리를 구성하는 알고리즘에는 간선 중심인 알고리즘과 노드 중심인 알고리즘이 있다.','그래프에서 가중치가 가장 작은 간선부터 선택하여 사이클을 형성하지 않도록 최소 신장 트리를 구성하는 알고리즘은?',4),(43,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','2를 곱해주어야 한다.','비트 연산을 활용해서 4를 8로 만들려고 한다. 물음표에 들어갈 적절한 비트 연산자를 쓰시오. 4 ? 1',4),(44,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','자식 노드 개수','이진 탐색 트리(Binary Search Tree)에서 삭제 연산의 경우의 수는 몇 가지인가요?',4),(45,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','모든 노드 간의 연결 정보를 기록한다.','그래프의 인접 행렬과 인접 리스트 중 공간 복잡도가 높은 것은?',4),(46,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','간선의 가중치를 기준으로 최소값을 빠르게 찾기 위해 사용','그래프에서 최단 경로를 찾기 위해 다익스트라 알고리즘을 사용할 때, 어떤 자료 구조를 활용해야 하는가?',4),(47,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','데이터를 고정된 범위로 변환하여 효율적인 검색을 가능케 함','임의의 크기의 데이터를 고정된 크기의 값으로 매핑하여 검색이나 저장에 활용하는 함수는?',4),(48,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','검색 범위를 반으로 나누어가면서 원하는 값을 찾아 나갑니다.','정렬된 배열에서 중간값을 통해 반씩 나누어가며 특정 값을 찾는 알고리즘으로 O(log n)의 시간복잡도를 갖는 탐색 알고리즘은?',4),(49,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','스택 또는 재귀를 사용하여 구현되며, 한 경로의 끝까지 탐색 후 다른 경로로 탐색 진행','그래프의 너비 우선 탐색(BFS)과 깊이 우선 탐색(DFS) 중에서 스택(Stack)을 사용하는 알고리즘은 무엇인가요?',4),(50,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','중앙처리장치와 같은 공용자원을 나누어 사용하는 것','운영체제에서 여러 응용 프로그램이 동시에 실행되는 환경을 제공하는 기능은 무엇인가요?',6),(51,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','프로세스의 가상 메모리 주소 공간에 파일을 매핑한 뒤 가상 메모리 주소에 직접 접근하는 것으로 파일 읽기/쓰기를 대신하는 것','프로세스 간의 통신을 위한 메커니즘 중 하나로, 특정한 공유 메모리 영역을 만들어 데이터를 공유하는 기술은 무엇인가요?',6),(52,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','자원을 최대한 공평하게 배분하며 처리율과 CPU 이용률을 증가시키고, 오버헤드, 응답시간(Response time / Turnaround time), 대기시간을 최소화하기 위한 기법','운영체제에서 실행 중인 프로그램을 효율적으로 관리하고, 필요에 따라 중단하거나 다시 시작하는 기능은 무엇인가요?',6),(53,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','하드 디스크, SSD 등의 보조 기억 장치에 파일을 저장하고 관리하는 것.','데이터를 저장하고 검색하기 위한 파일과 디렉터리의 조직체계를 관리하는 시스템 소프트웨어입니다. 파일의 생성, 삭제, 읽기, 쓰기 등의 동작을 제어합니다.',6),(54,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','명령어 해석기라고도 부르며 윈도우의 cmd, linux/unix의 bash 가 대표적인 예이다.','사용자가 운영체제와 상호작용하기 위한 텍스트 또는 그래픽 기반의 인터페이스를 제공하는 소프트웨어는 무엇인가요?',6),(55,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','임계구역을 가진 스레드들의 실행시간이 서로 겹치지 않고 각각 단독으로 실행(상호배제)되도록 하는 기술','상호 배제를 위한 동기화 도구로, 공유 자원에 대한 동시 접근을 제어하여 여러 프로세스 또는 쓰레드 간의 데이터 일관성을 보장합니다.',6),(56,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','운영체제의 90%를 차지하는 핵심부분으로, 운영체제 내부에서 컴퓨터의 하드웨어를 제어한다.','운영체제에서 하드웨어와 소프트웨어 간의 인터페이스 역할을 하는 중요한 계층은 무엇인가요?',6),(57,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','사용하고 있는 스레드/프로세스의 수를 공통으로 관리하는 하나의 값을 이용해 상호배제를 달성하는 것','프로세스 간의 동기화와 통신을 위한 기술로, 공유 변수의 동시 접근을 제어하는 메커니즘은 무엇인가요?',6),(58,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','프로세스를 작은 크기로 나누어서 외부 단편화를 해결하려고 하는 것','운영체제에서 메모리를 효율적으로 관리하기 위해 사용되는 메모리 공간 할당 기법 중 하나는 무엇인가요?',6),(59,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','속도가 빠른 장치와 느린 장치간의 속도 차에 따른 병목현상을 줄이기 위한 범용 메모리','주 기억장치와 CPU 사이에 위치하여 빠른 데이터 액세스를 제공하며 컴퓨터의 전반적인 성능을 향상을 도모하는 것은?',6),(60,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','한 방향으로만 삭제, 삽입이 가능하며 재귀적 알고리즘을 할 때 활용되는 자료구조입니다.','후입선출의 구조를 가지는 자료구조는 무엇인가요?',3),(61,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','이 자료구조는 인덱스를 통해 순차적으로 접근할 수 있습니다.','모두 같은 데이터 타입을 가지면서, 메모리에 일렬로 저장되는 자료구조는 무엇인가요?',3),(62,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','연결 리스트는 앞 노드와 연결을 끊고, 앞 노드는 바로 뒷 노드와 연결합니다. 연산에 걸리는 시간을 생각해보세요.','연결 리스트의 삽입, 삭제 연산의 시간복잡도는 얼마인가요?',3),(63,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','이진 트리의 정의를 생각해보세요.','이진 트리에서 각 노드가 최대 몇 개의 자식을 가질 수 있나요? (숫자로 입력해주세요)',3),(64,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','프림 알고리즘, 크루스칼 알고리즘이 이 자료구조를 찾는 데에 사용됩니다!','그래프 종류 중 하나로, 그래프의 모든 노드를 연결하면서 간선의 가중치의 합이 최소인 트리를 무엇이라 말하나요?',3),(65,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','한 방향으로 노드가 치우쳐 진 트리입니다.','이진 트리의 종류 중 배열로 구현을 할 때 메모리 낭비가 가장 심한 트리는 무엇인가요?',3),(66,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','이 자료구조는 우선순위 큐를 구현할 때 많이 사용합니다.','완전 이진 트리의 형태로 되어있고, 최댓값이나 최솟값을 빠르게 찾아낼 수 있는 자료구조는 무엇일까요?',3),(67,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','너비 우선 탐색에서 많이 사용돼요.','선입선출의 구조를 가지고, 한 방향으로만 넣을 수 있고 한 방향으로만 뺄 수 있는 자료구조는 무엇일까요?',3),(68,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','인덱스로 접근할 수 없으며, 합집합, 교집합과 같은 집합 연산을 지원하는 자료구조입니다.','중복된 원소를 허용하지 않고, 원소 간 순서가 없는 자료구조는 무엇인가요?',3),(69,'2024-01-23 18:11:12.000000','2024-01-23 18:11:12.000000','이 자료구조를 순회할 때는 주로 dfs, bfs를 사용합니다.','노드와 그 노드를 연결하는 간선을 하나로 모아놓은 자료구조로, 사이클을 가지는 것이 가능하고 부모-자식 개념이 없는 자료구조는 무엇인가요?',3);
